import React from 'react';
import './index.css';

const App=()=>{
    function Nav(){
        return (<>
            <div className="nav">
            <i class="fa fa-book" aria-hidden="true"></i>
            </div>
        </>);
    }
    return (<>
        <Nav/>

    </>);
}
export default App;
